import React from "react";
import HomeNavbar from "components/Navbars/HomeNavbar.js";
import Hero from "components/Hero/Hero.js";
class Home extends React.Component {
    constructor(props) {
      super(props);
    }

    render() {
      return (
        <>
         <div className="wrapper">
          <div
            className="main-panel"
            ref="mainPanel"
          >
             <HomeNavbar />

             <Hero />
          </div>
        </div>




        </>
      );
    }
  }

  export default Home;
